<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <title>Node Socket Test Page</title>

    <script src="/socket.io/socket.io.js"></script>
    <script src="/lib/jquery/dist/jquery.min.js"></script>

    <link rel="stylesheet" href="/lib/bootstrap/dist/css/bootstrap.css">
    <script src="/lib/bootstrap/dist/js/bootstrap.js"></script>

    <script>
        var constants = JSON.parse('{{ constants  | json | safe }}');
        console.log(constants);
    </script>

    <style>
        #msgPanel{
            max-height: 250px;
            margin: 10px;
            padding: 10px;
            border: solid 1px grey;
            overflow-x: hidden;
        }

        .event-item{
            margin-bottom: 10px;
            padding: 5px;
            background-color: #9acfea;
            font-weight: bold;
        }
    </style>
</head>
<body>
    <h1>Welcome Deer.</h1>
    <h3>This is a test page for detect server status</h3>

    <div style="margin: 10px; padding: 10px;">
        <input type="text" id="msgInput">
        <button type="button" id="btnSend" onclick="sendMessage()">Send Message</button>
    </div>

    <div id="msgPanel">

    </div>

    <div class="container">
        <h3>Visit Lobby Page</h3>
        <button class="btn btn-warnning" onclick="visitLobbyPage()">Visit</button>
    </div>
    <div class="container">
        <h3>Create Backgammon Game</h3>
        <div class="row">
            <div class="col-xs-3">
                <label>Room Name</label>
                <input class="form-control" type="text" id="game-name">
            </div>
            <div class="col-xs-3">
                <label>Game Ammount</label>
                <input class="form-control" type="number" id="game-amount">
            </div>
            <div class="col-xs-3">
                <label>Win Points</label>
                <input class="form-control" type="number" id="game-win-point">
            </div>
            <div class="col-xs-3">
                <button class="btn btn-primary form-control" onclick="createNewGame()">Create</button>
            </div>
        </div>
    </div>

    <div class="container">
        <h3>Join To a Backgammon Game</h3>
        <div class="row">
            <div class="col-xs-9">
                <input type="text" class="form-control" placeholder="gameId of need join game" id="join-game-id">
            </div>
            <div class="col-xs-3">
                <button class="btn btn-primary form-control" onclick="joinToGame()">Join</button>
            </div>
        </div>
    </div>

    <script>
        var socket = io('http://localhost:3111', {transports: ['websocket', 'polling', 'flashsocket']});
        // var socket = io('https://goldgameserver.herokuapp.com/', {transports: ['websocket', 'polling', 'flashsocket']});
        socket.on('connect', function(){
            console.log('connected');
            var msgItem =  document.createElement('div');
            msgItem.innerHTML = 'Connected';
            document.getElementById('msgPanel').appendChild(msgItem);
        });

        socket.on('test-message', function (data) {
            addEventData('Test-Message', data);
        });

        socket.on('ans-message', function (data) {
            var msgItem =  document.createElement('div');
            msgItem.innerHTML = 'Answer Message from ' + data.roomId + ' ::  ' + data.message;
            document.getElementById('msgPanel').appendChild(msgItem);
        });

        socket.on('disconnect', function () {
            var msgItem =  document.createElement('div');
            msgItem.innerHTML = 'Disconnected';
            document.getElementById('msgPanel').appendChild(msgItem);
        });

        socket.on('connect_failed', function () {
            console.log('-----------------**************** fail connect');
        });

        socket.on('connect_error', function (data) {
            console.log('************ error connection_error');
        });

        socket.on('error', function (err) {
            console.log('************ error ');
            console.log(err);
        });

        function sendMessage() {
            var msg = document.getElementById('msgInput').value;
            socket.emit('test-message', {message: msg, roomId: 'From browser'});
            document.getElementById('msgInput').value = '';
        }

        function addEventData(event_name, data) {
            $('<div class="event-item">' + event_name + ' ::  ' + JSON.stringify(data) + '</div>').appendTo($('#msgPanel'));
            $('#msgPanel').scrollTop(100000);
        }

        socket.on(constants.EVENT_CONNECT_USER, function (data) {
            addEventData('Connect User', data);
        });

        socket.on(constants.EVENT_DISCONNECT_USER, function (data) {
           addEventData('Disconnect User', data);
        });

        socket.on(constants.EVENT_ERROR, function (data) {
            addEventData('Error', data);
        });

        function visitLobbyPage(){
            socket.emit(constants.EVENT_VISIT_BACKGAMMON_LOBBY, {});
        }

        socket.on(constants.EVENT_ANSWER_CREATE_BACKGAMMON_GAME, function (data) {
            addEventData('Answer for create a backgammon game', data);
        });

        socket.on(constants.EVENT_CREATE_A_NEW_BACKGAMMON_ROOM, function (data) {
            addEventData('Create a new Backgammon game', data);
        });

        socket.on(constants.EVENT_CHANGE_WAITING_BACKGAMMON_ROOMS, function (data) {
            addEventData('Changed waiting backgammon game rooms', data);
        });

        socket.on(constants.EVENT_REMOVE_A_BACKGAMMON_ROOM, function (data) {
            addEventData('Destroy a backgammon game', data);
        });

        socket.on(constants.EVENT_ANSWER_JOIN_BACKGAMMON_GAME, function (data) {
            addEventData('joined to a backgammon game', data);
        });

        function createNewGame() {
            var newGame = {
                gameName: $('#game-name').val(),
                gameAmount: $('#game-amount').val(),
                winPoints: $('#game-win-point').val()
            };

            socket.emit(constants.EVENT_CREATE_BACKGAMMON_GAME, newGame);
        }

        function joinToGame() {
            var joinGame = {
                _id: $('#join-game-id').val()
            };

            socket.emit(constants.EVENT_JOIN_BACKGAMMON_GAME, joinGame);
        }
